import React from "react";
import "./style.css";
import "./form.css";
import userIcon from "./Assets/user.svg";
import lockIcon from "./Assets/lock.svg";
import cartIcon from "./Assets/cart.svg";
import vector from "./Assets/vector.svg";
import {LoginForm} from './form';

class Login extends React.Component  {
  constructor(props) {
    super(props);
    this.state = {
        userName : '',
        password : ''  };
    this.handleChange = handleChange.bind(this);
    this.handleSubmit = handleSubmit.bind(this);
  }
  
  handleSubmit(e) {
    e.preventDefault();
    
    console.log('Form was submitted, the username is '+{this:state.userName});
  }
  
  
  handleChange(target){
    this.state.value.userName = target.value;
    console.log({userName});

  }

  render (){
    return(
    <div className="dashboard-login">
      <div className="overlap-wrapper">
        <div className="overlap">
          <div className="BG">
            <div className="overlap-group">
              <div className="ellipse" />
              <div className="div" />
            </div>
            <img className="vector" alt="Vector" src={vector}/>
          </div>
         
          <div className="form">
          <form onSubmit={handleSubmit} >           
              <div className="username">
                <div className="overlap-group-2">

                  <img className="img" alt="User" src={userIcon} />
 
                    <input onChange={this.updateInput} placeholder="USERNAME" />                  
                </div>    
               
              </div>
              <div className="password">
                  <div className="overlap-group-2">
                    <img className="img" alt="Lock" src={lockIcon} />

                      <input placeholder="PASSWORD" />

                  </div>
                </div>
            
            <button className="login-btn" onClick={this.handleSubmit}>
              <div className="login-wrapper">
                <div className="login">LOGIN</div>
              </div>
            </button>
            <div className="text-wrapper-2">Forgot password?</div>
            <img className="group" alt="group" src={cartIcon} />
          </form>
          </div>
        </div>
      </div>
    </div>)
  };
};
